    //     initFlag_ = true;
    // }

    function resourceWhite(address _target, bool _allow)
        public
        onlyAdmin
        returns (bool)
    {
        require(
            ResourceDB(ResDB_).mangeWhiteList(_target, _allow),
            "resourceWhite"
        );
        return true;
    }

    function orderWhite(address _target, bool _allow)
        public
        onlyAdmin
        returns (bool)
    {
        require(
            OrderDB(OrderDB_).mangeWhiteList(_target, _allow),
            "orderWhite"
        );
        return true;
    }

    function infoWhite(address _target, bool _allow)
        public
        onlyAdmin
        returns (bool)
    {
        require(InfoDB(InfoDB_).mangeWhiteList(_target, _allow), "infoWhite");
        return true;
    }

    function end(address _newAdmin) public onlyAdmin returns (bool) {
        ResourceDB(ResDB_).transferAdminship(_newAdmin);
        OrderDB(OrderDB_).transferAdminship(_newAdmin);
        InfoDB(InfoDB_).transferAdminship(_newAdmin);
        return true;
    }
}

